            default:
                return <div>{'None Selected'}</div>
        }
    }
    render(){
        return <div>
            {handleFunction()}
        </div>
    }
}

const styles= {}

function mapStateToProps(state){
    return {
        fn: state.fn
    }
}

export default Model;
